class Solution:
    def findAnagrams(self, s: str, p: str) -> List[int]:
        mp = defaultdict(int)
        for c in p: 
            mp[c] += 1

        copy, start, res = mp.copy(), 0, []

        for i in range(len(s)):
            if s[i] in copy.keys():
                if copy[s[i]] == 0:
                    start = i
                    copy = mp.copy()
                copy[s[i]] -= 1
            else:
                start = i + 1
                copy = mp.copy()
            if sum(copy.values()) == 0:
                res.append(start)
                copy = mp.copy()
                start = i
                copy[s[i]] -= 1
        return res

class Solution:
    def isAnagram(self, s: str, t: str) -> bool:
        if len(s) != len(t):
            return False
        table = defaultdict(int)
        for c1, c2 in zip(s, t):
            table[c1] += 1
            table[c2] -= 1
        for k in table.keys():
            if table[k]:
                return False
        return True

