class Solution:
    def isPalindrome(self, s: str) -> bool:
        lo, hi = 0, len(s) - 1
        while lo <= hi:
            if s[lo].isalnum() and s[hi].isalnum():
                if s[lo].lower() != s[hi].lower():
                    return False
                lo += 1
                hi -= 1
            else:
                if not s[lo].isalnum():
                    lo += 1
                if not s[hi].isalnum():
                    hi -= 1
        return True

