class Solution:
    def palFromPos(self, s, l, r):
        while l >= 0 and r < len(s) and s[l] == s[r]:
            l -= 1
            r += 1
        return s[l+1:r]
    def longestPalindrome(self, s: str) -> str:
        res = ''
        for i in range(len(s)):
            s1 = self.palFromPos(s, i, i)
            if len(s1) > len(res):
                res = s1
            s1 = self.palFromPos(s, i, i + 1)
            if len(s1) > len(res):
                res = s1
        return res

class Solution:
    def lengthOfLongestSubstring(self, s: str) -> int:
        anchor = 0
        res = 0

        charMap = {}

        for i in range(len(s)):
            if s[i] in charMap:
                anchor = max(charMap[s[i]], anchor)
            res = max(res, i - anchor + 1)
            charMap[s[i]] = i + 1

        return res

class Solution:
    def threeSum(self, nums: List[int]) -> List[List[int]]:
        nums.sort()
        sols, n = [], len(nums)
        for i in range(n - 2): # because of lo and duplicate check
            if i > 0 and nums[i] == nums[i-1]:
                continue
            lo, hi = i + 1, n - 1
            while lo < hi:
                targ = nums[i] + nums[lo] + nums[hi]
                if targ == 0:
                    sols.append([nums[i], nums[lo], nums[hi]])
                    while lo < hi and nums[hi] == nums[hi-1]:
                        hi -= 1
                    while lo < hi and nums[lo] == nums[lo + 1]:
                        lo += 1
                    lo, hi = lo + 1, hi - 1
                elif targ < 0:
                    lo += 1
                else:
                    hi -= 1
        return sols

