class Solution:
    def threeSum(self, nums: List[int]) -> List[List[int]]:
        if len(nums) < 3:
            return []

        sols, n = set(), len(nums) - 1

        for i in range(n):
            targ = -nums[i]
            twoSum = {}

            for j in range(len(nums)):
                if j != i:
                    if nums[j] in twoSum.keys():
                        sol = [nums[i], nums[j], nums[twoSum[nums[j]]]]
                        # print(sol)
                        sols.add(tuple(sorted(sol)))
                    twoSum[targ - nums[j]] = j
        return sols

