class Solution:
    def maxProduct(self, nums: List[int]) -> int:
        prod, best = 1, -inf
        # forward
        for i in range(len(nums)):
            prod = max(nums[i], prod * nums[i])
            if nums[i] == 0:
                prod = 1
            best = max(best, prod)
        # reverse
        prod = 1
        for i in reversed(range(len(nums))):
            prod = max(nums[i], prod * nums[i])
            if nums[i] == 0:
                prod = 1
            best = max(best, prod)
        return best

class Solution:
    def maxProduct(self, nums: List[int]) -> int:
        best = min(nums)
        pre = post = 1
        n = len(nums)
        for i in range(n):
            pre *= nums[i]
            post *= nums[n-i-1]
            best = max(best, pre, post, nums[i], nums[n-i-1])
        return best

