        # go left
        for i in range(mid - 1, l - 1, - 1):
            lsc += nums[i]
            ls = max(lsc, ls)
        # go right
        for i in range(mid + 1, r + 1):
            rsc += nums[i]
            rs = max(rsc, rs)
        return max(lsum, rsum, ls + rs + nums[mid])
